  \"2013-03-19T00:27:24.669922\",\n\t\"name\": \"geochemical-major-oxide-minor-oxide-trace-element-and-carbon-data-from-rocks-collected-in-2008-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Mineral-resources personnel from the Alaska
  Division of Geological & Geophysical Surveys carried out a geological field survey,
  including mapping and sampling in the eastern part of the Bonnifield mining district
  in the Fairbanks A-1, A-2, Healy D-1 and D-2 quadrangles, Alaska from June 16 to
  July 18, 2008. The fieldwork provides basic information critical to building an
  understanding of Alaska geology and is part of an integrated program of airborne
  geophysical surveys followed by geological mapping. During 2008, 242 rock samples
  were collected for geochemical trace-element analysis, 106 rock samples were collected
  for whole rock (major- and minor-oxide and petrogenetically important trace element)
  analyses, and 7 samples were collected for analysis of non-carbonate carbon content.\",\n\t\"license_title\":
